import axios from 'axios'

export const reqLogin = (usernames, password) => {
  // package.json中配置代理 写服务器的地址 注意配置写的位置，花括号前的最下面  这里写项目开发地址
  axios.post("http://localhost:3000/login").then((usernames, password) => {
    console.log(usernames, password);
  }).catch((err) => {
    console.log(err);
  })
}
